import React, { useState } from 'react';
import './App.css'; // Assuming this file contains your CSS styles

const Navbar = () => {
      const [isOpen, setIsOpen] = useState(false);

      const toggleNavbar = () => {
            setIsOpen(!isOpen);
      };

      return (
            <nav className="py-3 App home py-10">
                  <div className="container">
                        <div className="flex justify-between items-center">
                              <div className="text-xl text-black flex space-x-2">
                                    <img src="images/m.jpg" className="mx-1 h-8 rounded-full" alt="Logo" />
                                    <h1>MITHILESH KUMAAR.</h1>
                              </div>
                              <div className="md:hidden text-3xl cursor-pointer text-black mx-5" onClick={toggleNavbar}>
                                    <ion-icon name={isOpen ? 'Close' : 'Menu'} className="text-xl"></ion-icon>
                              </div>
                              <div className={`md:flex ${isOpen ? 'block' : 'hidden'}`}>
                                    <ul className="md:flex flex-col md:flex-row space-y-4 md:space-y-0 md:space-x-4 md:pt-4">
                                          <li><a href="#about" className="text-white">Home</a></li>
                                          <li><a href="#" className="text-white">Projects</a></li>
                                          <li><a href="#" className="text-white">About me</a></li>
                                          <li><a href="#" className="text-white">Contact</a></li>
                                    </ul>
                              </div>
                        </div>
                  </div>
            </nav>
      );
};

export default Navbar;
